INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Przesyłki', '', 'Nasze zasady i warunki dostawy', 'conditions, delivery, delay, shipment, pack, przesyłki, przesylki', '<h2>Przesyłki i zwroty</h2>\n<h2><span style=\"font-size:11px;\">Twoja przesyłka w paczce</span></h2>\n<p>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i wysyłane za pośrednictwem firmy UPS ze śledzeniem i doręczeniem bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Niezależnie od tego, jaką przesyłkę wybierzesz, udostępnimy Ci link umożliwiający śledzenie przesyłki online.</p>\n<p></p>\n<p>Opłaty za wysyłkę obejmują opłaty manipulacyjne i pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Radzimy zgrupować produkty w jednym zamówieniu. Nie możemy zgrupować dwóch odrębnych zamówień złożonych osobno, a opłaty za wysyłkę będą obowiązywać w przypadku każdego z nich. Przesyłkę wysyłasz na własne ryzyko, jednak dokładamy wszelkich starań, aby chronić delikatne przedmioty.</p>\n<p><br />Pudełka są dość duże, a Twoje przedmioty są dobrze chronione.</p>', 'przesylki'),
(2, 1, 1, 'Nota prawna', '', 'Nota prawna', 'notice, legal, credits, nota prawna, nota-prawna', '<h3>Koncepcja i produkcja:</h3>\n<p>Niniejsza witryna internetowa została utworzona przy użyciu oprogramowania typu open source PrestaShop™.</p>', 'nota-prawna'),
(3, 1, 1, 'Regulamin użytkowania', '', 'Nasze warunki użytkowania', 'conditions, terms, use, sell, Nasze warunki użytkowania, Regulamin użytkowania', '<h2>Twoje warunki użytkowania</h2>\n<h3>Zasada nr 1</h3>\n<p>Klient ma możliwość kontaktu z prowadzącym sklep internetowy w każdy z poniższych sposobów: pod adresem E-sklep Mohito.com, ul. Tczewska 2, budynek C, 83-000 Pruszcz Gdański,</p>\n<h3>Zasada nr 2</h3>\n<p>Ze sklepu internetowego mogą korzystać tylko osoby, które ukończyły 18 lat.</p>\n<h3>Zasada nr 3</h3>\n<p>Po wybraniu przez Klienta towaru w danym rozmiarze, należy kliknąć ikonę „Dodaj do koszyka”.</p>', 'regulamin-uzytkowania'),
(4, 1, 1, 'O nas', '', 'Dowiedz się więcej o nas', 'about us, informations, o nas, Dowiedz się więcej o nas', '<h2>O nas</h2>\n<h3>Nasza marka</h3>\n<p>MOHITO to propozycja dla wielbicielek mody, ceniących niebanalną elegancję. Marka uważnie śledzi światowe trendy, zachowując równowagę pomiędzy modowymi inspiracjami a wygodą i funkcjonalnością, szczególnie poszukiwaną w obecnych czasach. W sklepie odnaleźć można klasyczne i nowoczesne kroje, bogatą gamę kolorów oraz wzorów.</p>', 'o-nas'),
(5, 1, 1, 'Bezpieczna płatność ​', '', 'Nasz bezpieczny sposób płatności', 'secure payment, ssl, visa, mastercard, paypal, platnosc, płatność', '<h2>Bezpieczna płatność</h2>\n<h2><span style=\"font-size:11px;\">Nasza bezpieczna płatność</span></h2>\n<p>Z protokołem SSL</p>\n<h3>Korzystanie z karty Visa/Mastercard/Paypal</h3>\n<p>O tych usługach</p>', 'bezpieczna-platnosc-');
