INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1, 1, 1, '<p>Koronkowa sukienka o długości maxi z długim rękawem i kopertowym dekoltem. długość maxi długi rękaw kopertowy dekolt rozcięcie na dole</p>', '', 'koronkowa-sukienka-maxi', '', '', '', 'Koronkowa sukienka maxi', '', '', '', ''),
(2, 1, 1, 'Koronkowa sukienka o długości maxi i dopasowanym kroju.\n\n\ndługość maxi\nwysoka stójka\ndługie rękawy\nwyeksponowane plecy\nzapięcie na zamek i guziki\nrozcięcie z tyłu\nozdobna koronka', '', 'koronkowa-sukienka-maxi', '', '', '', 'Koronkowa sukienka maxi', '', '', '', ''),
(3, 1, 1, '<p>Sukienka o długości mini z asymetrycznym dołem i długimi rękawami. Posiada ozdobny, swobodny detal. długość mini wysoka stójka długie rękawy asymetryczny dół ozdobny detal</p>', '', 'sukienka-mini-z-asymetrycznym-dolem', '', '', '', 'Sukienka mini z asymetrycznym dołem', '', '', '', ''),
(4, 1, 1, '<p>Koronkowa sukienka o długości mini z gorsetem i długim rękawem. długość mini długi rękaw krój litery A dekolt w serce z gorsetem ozdobna koronka</p>', '', 'koronkowa-sukienka-mini', '', '', '', 'Koronkowa sukienka mini', '', '', '', ''),
(5, 1, 1, '<p>Sukienka o długości maxi z długim, bufiastym rękawem i ozdobnymi falbanami. Posiada wzór w kratę. długość maxi dekolt w kształcie V długie rękawy ozdobne falbany wzór w kratę szyfonowe wykończenie</p>', '', 'sukienka-maxi-w-krate', '', '', '', 'Sukienka maxi w kratę', '', '', '', ''),
(6, 1, 1, 'Elegancka sukienka o długości maxi w kolorze czerwonym, z rozcięciem z przodu.\n\n\ndługość maxi\ndekolt V\nszerokie ramiączka\nrozcięcie z przodu', '', 'czerwona-sukienka-maxi', '', '', '', 'Czerwona sukienka maxi', '', '', '', ''),
(7, 1, 1, 'Welurowa sukienka w o długości mini w czarnym kolorze, z bufiastymi rękawami i dekoltem V.\n\n\ndługość mini\ndekolt w kształcie V\nbufiaste rękawy\nzapięcie na zamek\nwelurowy materiał', '', 'welurowa-sukienka-mini', '', '', '', 'Welurowa sukienka mini', '', '', '', ''),
(8, 1, 1, 'Koszulowa sukienka o długości midi w kratę. Posiada pasek w komplecie. Uszyta z wiskozy.\n\n\ndługość midi\nklasyczny kołnierz\ndługie rękawy\nzapięcie na guziki\nfalbana na dole\nwzór w kratę\n100% wiskoza', '', 'koszulowa-sukienka-midi-w-krate', '', '', '', 'Koszulowa sukienka midi w kratę', '', '', '', ''),
(9, 1, 1, 'Welurowa sukienka o długości mini z kopertowym dekoltem.\n\n\ndługość mini\nkopertowy dekolt\ndługie rękawy\nwiązanie w talii\nfalbana na dole\nmateriał z dodatkiem wiskozy', '', 'welurowa-sukienka-mini', '', '', '', 'Welurowa sukienka mini', '', '', '', ''),
(10, 1, 1, 'Czarna sukienka o długości mini i dopasowanym kroju z cekinami.\n\n\ndopasowany krój\ndługość mini\ndługi rękaw\nodkryte plecy\nzapięcie na zamek\nozdobne cekiny', '', 'mini-sukienka-z-cekinami', '', '', '', 'Mini sukienka z cekinami', '', '', '', ''),
(11, 1, 1, 'Czerwona sukienka o długości midi z długim rękawem i ozdobnymi falbanami.\n\n\ndługość midi\ndługie rękawy\nkopertowy dekolt\nwiązanie w talii\nozdobne falbany\nzapięcie na zamek', '', 'sukienka-midi-z-falbanami', '', '', '', 'Sukienka midi z falbanami', '', '', '', ''),
(12, 1, 1, 'Cekinowa sukienka o długości mini w czarnym kolorze. Posiada dekolt w kształcie litery V i zapięcie na zamek.\n\n\ndługość mini\ndekolt w kształcie V\ndługie rękawy\nzapięcie na zamek\nozdobne cekiny', '', 'cekinowa-czarna-sukienka-mini', '', '', '', 'Cekinowa czarna sukienka mini', '', '', '', ''),
(13, 1, 1, 'Dopasowana sukienka o długości mini z ozdobnymi guzikami w złotym kolorze. Posiada wzór w kratę.\n\n\ndługość mini\ndługie rękawy\nozdobne guziki\nzapięcie na zamek\nwzór w kratę\nwysoka zawartość wiskozy', '', 'sukienka-mini-w-krate', '', '', '', 'Sukienka mini w kratę', '', '', '', ''),
(14, 1, 1, 'Stylowa sukienka o długości mini z ozdobnym paskiem w zestawie.\n\n\ndlugość mini\nodkryte ramiona\nrękawy 3/4\npasek w komplecie\nzapięcie na zamek\nwelurowy materiał', '', 'sukienka-mini-z-paskiem', '', '', '', 'Sukienka mini z paskiem', '', '', '', ''),
(15, 1, 1, 'Welurowa sukienka o długości mini w butelkowym odcieniu zieleni, z bufiastymi rękawami i dekoltem V.\n\n\ndługość mini\ndekolt w kształcie V\nbufiaste rękawy\nzapięcie na zamek\nwelurowy materiał', '', 'welurowa-zielona-sukienka-mini', '', '', '', 'Welurowa zielona sukienka mini', '', '', '', ''),
(16, 1, 1, 'Czarna sukienka o długości mini i kroju oversize. Posiada długie, bufiaste rękawy.\n\n\ndługość mini\nbufiaste rękawy\nkrój oversize\nwycięcie na plecach\nbłyszcząca nitka', '', 'sukienka-mini-oversize', '', '', '', 'Sukienka mini oversize', '', '', '', ''),
(17, 1, 1, 'Welurowa czerwona sukienka o długości mini z bufiastymi rękawami i dekoltem V.\n\n\ndługość mini\ndekolt w kształcie V\nbufiaste rękawy\nzapięcie na zamek\nwelurowy materiał', '', 'welurowa-czerwona-sukienka-mini', '', '', '', 'Welurowa czerwona sukienka mini', '', '', '', ''),
(18, 1, 1, 'Czarna sukienka o długości mini oraz asymetrycznym kroju. Posiada błyszczące drobinki na całości.\n\n\ndługość mini\ndługi rękaw\nkopertowy dekolt\nasymetryczny dół\nbłyszczące drobinki', '', 'asymetryczna-czarna-sukienka-mini', '', '', '', 'Asymetryczna czarna sukienka mini', '', '', '', ''),
(19, 1, 1, 'Wzorzysta sukienka o długości mini z dzianiny mesh. Posiada zapięcie z tyłu.\n\n\ndługość mini\ndługie rękawy\nzapięcie z tyłu\nokrągły dekolt\nzapięcie na zamek', '', 'wzorzysta-sukienka-mini-z-dzianiny-mesh', '', '', '', 'Wzorzysta sukienka mini z dzianiny mesh', '', '', '', ''),
(20, 1, 1, 'Sukienka o długości mini z dzianiny mesh. Posiada zapięcie z tyłu.\n\n\ndługość mini\ndługie rękawy\nzapięcie z tyłu\nokrągły dekolt\nzapięcie na zamek', '', 'sukienka-mini-z-dzianiny-mesh', '', '', '', 'Sukienka mini z dzianiny mesh', '', '', '', ''),
(21, 1, 1, 'Czarny kombinezon z rękawami i kopertowym dekoltem. Posiada ozdobne cekiny.\n\n\nkopertowy dekolt\nrękaw 3/4\nszeroka nogawka\nwiązanie w talii\nwelurowy dół', '', 'kombinezon-z-cekinami', '', '', '', 'Kombinezon z cekinami', '', '', '', ''),
(22, 1, 1, 'Koszulowa sukienka o długości mini w kolorze czarnym. Posiada ozdobne wiązanie w talii.\n\n\ndługość mini\nkoszulowy krój\ndługi rękaw\nozdobna koronka\nzapięcie na guziki\nwiązanie w talii', '', 'koronkowa-czarna-sukienka-mini', '', '', '', 'Koronkowa czarna sukienka mini', '', '', '', ''),
(23, 1, 1, 'Czerwona sukienka o długości midi z plisowanym dołem i koszulową górą z kołnierzykiem, zapinana na guziki. Posiada długie rękawy oraz pasek.\n\n\ndługość midi\ndługi rękaw\nkoszulowa góra z kołnierzykiem i guzikami\nplisowany dół\npasek w komplecie', '', 'czerwona-sukienka-midi-z-plisowanym-dolem', '', '', '', 'Czerwona sukienka midi z plisowanym dołem', '', '', '', ''),
(24, 1, 1, 'Czarna sukienka o długości midi z plisowanym dołem i koszulową górą z kołnierzykiem, zapinana na guziki. Posiada długie rękawy oraz pasek. Uszyta z materiału z dodatkiem błyszczącej nitki.\n\n\ndługość midi\ndługi rękaw\nkoszulowa góra z kołnierzykiem i guzikami\nplisowany dół\npasek w komplecie\nbłyszcząca nitka', '', 'czarna-sukienka-midi-z-plisowanym-dolem', '', '', '', 'Czarna sukienka midi z plisowanym dołem', '', '', '', ''),
(25, 1, 1, 'Welurowa bordowa sukienka o długości mini z kopertowym dekoltem.\n\n\ndługość mini\nkopertowy dekolt\ndługie rękawy\nwiązanie w talii\nfalbana na dole\nmateriał z dodatkiem wiskozy', '', 'welurowa-bordowa-sukienka-mini', '', '', '', 'Welurowa bordowa sukienka mini', '', '', '', ''),
